import React, { useRef,useState } from "react";
import { OrbitControls } from "@react-three/drei";
import { useFrame,useThree } from "react-three-fiber";
import { Vector2, Raycaster } from "three";
import * as THREE from 'three';

const RubiksCubeModel = ({ nodesSubset, drag, onDragChange }) => {
  const cubeRefs = useRef([]);
  const orbitRef = useRef();
  const startYRef = useRef(0);
  const initialRotation = [Math.PI / 6, Math.PI / 4, 0];
  const groupRef = useRef();
  const [mouse, setMouse] = useState(new THREE.Vector2());
  const [startY, setStartY] = useState(null);
  const { camera } = useThree();


  const raycaster = new THREE.Raycaster();
  const intersectedCubeRef = useRef(null);
  let dragStart = new THREE.Vector2();

let x,y,z,mousep;


  const handlePointerDown = (event) => {
   x= orbitRef.current.object.rotation.x
   y= orbitRef.current.object.rotation.y
   z= orbitRef.current.object.rotation.z

  //  console.log("x "+x);
  //  console.log("y "+y);
  //  console.log("z "+z);
  // setStartY(event.clientY);

 setStartY(mousep);
console.log("start "+mousep);
